import React from 'react';
import { SparklesCore } from './sparkles';

const SparklesTest = () => {
  return (
    <div style={{ height: '400px', position: 'relative' }}>
      <SparklesCore
        id="testSparkles"
        background="transparent"
        minSize={0.6}
        maxSize={1.2}
        particleDensity={70}
        particleColor="#5D87FF"
        speed={0.5}
      />
      <h1 style={{ position: 'relative', zIndex: 10, textAlign: 'center', paddingTop: '150px', color: 'white' }}>
        SparklesCore Test
      </h1>
    </div>
  );
};

export default SparklesTest;
